import React, { useState } from 'react'

export default function Room() {
  const [rooms, setRooms] = useState([])

  return (
    <div>
      <h4>Room 1</h4>
      {
        rooms.map(room => {
          <div className="room">
            <p>{room.number}</p>
          </div>
        })
      }
    </div>
  )
}
